import logo from './logo.svg';
import './App.css';
import {Routes, Route,Link, useNavigate} from "react-router-dom";
import Modal from './modiary.js';
import Home from "./Home.js";
import Notice from "./Notice.js";
import React, {useEffect, useState} from "react"
import axios from "axios"



function History() {
  const [diary, setDiary] = useState([]);
  const [page, setPage] = useState(1);
  const navigate = useNavigate();

  const MyComponent = () => {
    const [data, setData] = useState(null);
  }

  // useEffect(()=> {
  //   axios.get('').then((response) => {
  //     console.log(response);
  //   })
  // },[])

  useEffect(() => {
    const fetchDiary = async () => {
      const response = await fetch(`http://localhost:5000/diaries?page=${page}`);
      const data = await response.json();
      setDiary(data);
    };

    fetchDiary();
  }, [page]);


  
    return (
      <>
      <div className="App">
        <div>
          <h5>
             방문자님,<br />
            환영합니다.<br /><br />
            <div className="one"></div>
          </h5>
          
          <ul className="navigation-menu">
            <li><Link to="/Home">홈</Link></li><br />
            <li><Link to="/Notice">게시판</Link></li><br />
            <li><div className="click">히스토리</div></li><br />
          </ul>
          
          <Routes>
            <Route path="/Home" element={<Home />}></Route>
            <Route path="/Notice" element={<Notice />}></Route>
          </Routes>
        </div>
  
        <h1>
          your history!
        </h1>
        </div>

      <div>
        <ul>
          {diary.map((diary, index) => (
            <li key={index}>{diary.content}</li>
          ))}
        </ul>
        <div className ="nextbutton">
          <button onClick={() => setPage(page - 1)} disabled={page === 1}>
            Previous
          </button>
          <button onClick={() => setPage(page + 1)}>
            Next
          </button>
        </div>
    </div>


        {/* 7개씩 데이터를 뜨게 하는 코드 */}
        {/* {diary.map((a, i) => {
            return <Card diary ={i} key={i}></Card>
          })} */}


        
        {/* 데이터를 받는 코드인데 실습대로 버튼기능에 넣어봄 */}
        {/* <button onClick={() => {
                        axios.get('url주소적기') //데이터 요청하는 백 url넣어야함 
                        .then((결과) => {
                            console.log(결과.data)
                            let copy = [...diary, ...결과.data]; //리스트 [] 벗기고 {}만 정렬해줌
                            setDiary(copy); 
                        })
                        .catch (() => {
                            console.log(결과.data)
                        })
                    }   

                    } >
        자료 받기 
        </button>               */}
      </>
